function formatDate() {
    let date = new Date();
    let year = new Intl.DateTimeFormat('en', { year: '2-digit', timeZone: 'Asia/Kuala_Lumpur' }).format(date);
    let month = new Intl.DateTimeFormat('en', { month: '2-digit', timeZone: 'Asia/Kuala_Lumpur' }).format(date);
    let day = new Intl.DateTimeFormat('en', { day: '2-digit', timeZone: 'Asia/Kuala_Lumpur' }).format(date);
    let time = new Date().toLocaleTimeString('en-GB', { hour12: false, timeZone: 'Asia/Kuala_Lumpur' });
    return `${day}-${month}-${year} ${time}`;}

